import { Component } from "react";

class Table extends Component {

  constructor(props) {
    super(props);
    this.state = { count: 0 }
  }

  render() {
    return (
      <div>
        <h1>Count : {this.state.count}</h1>
        <button type="button" onClick={()=>this.setState({count:this.state.count+10})}>click</button>
        <button type="button" onClick={()=>this.setState({count:this.state.count-10})}>click</button>
      </div>
    )

  }
}
export default Table;
